                # Call layer.
                if node.arguments:
                    kwargs = node.arguments
                else:
                    kwargs = {}
                computed_tensors = [x[0] for x in computed_data]

                # Call layer with input tensors and kwargs.
                if len(computed_tensors) == 1:
                    kwargs['mask'] = None  # Set mask to None if not available
                else:
                    if 'mask' not in kwargs or kwargs['mask'] is None:
                        kwargs['mask'] = [None] * len(computed_tensors)

